class Slide2 extends ConsumerStatefulWidget {
  const Slide2({super.key});

  @override
  ConsumerState<Slide2> createState() => _Slide2State();
}

class _Slide2State extends ConsumerState<Slide2> {
  late AudioPlayer player = AudioPlayer();

  int currentIndex = 0;
  List<bool> _visibilityList = List.filled(5, false);
  bool titleVisibility = false;
  String button1 = 's1';

  int start = 0;
  bool isPaused = false;
  PlayerState? _playerState;
  bool stopFunction = false;
  late int startModule;

  void initialize() {
    startModule = ref.read(startProvider);
    prechecks = ref.read(prechecksProvider);
  }

  @override
  void initState() {
    super.initState();

    initialize();
    print(ref.read(mapListProvider));

    print("Start Provider $startModule ${ref.read(startProvider)}");
    print("Prechecks Provider $prechecks ${ref.read(prechecksProvider)}");

    print("prechecks ${ref.read(prechecksProcedure)}");
    print("bprechecks ${ref.read(bprechecksProcedure)}");
    print("systemchecks ${ref.read(systemchecksProcedure)}");
    print("shutdown ${ref.read(shutdownProcedure)}");

    Future.delayed(
      const Duration(seconds: 2),
      () async {
        _showNextText();
      },
    );
  }

  Future<void> _waitForFlagToChange() async {
    while (isPaused) {
      await Future.delayed(const Duration(milliseconds: 100));
    }
  }

  // Future<void> _waitForTitle(bool title) async {
  //   while (!title) {
  //     await Future.delayed(const Duration(milliseconds: 100));
  //   }
  // }

  int prechecks = 0;
  int moduleLength = 0;
  int moduleId = 0;
  int stepId = 0;

  void _showNextText() async {
    while (!stopFunction) {
      for (int i = start;
          (ref
                          .read(mapListProvider)[prechecks]["steps"]
                              [startModule]["steps"]
                          .length -
                      start <=
                  4
              ? i <=
                  ref
                      .read(mapListProvider)[prechecks]["steps"][startModule]
                          ["steps"]
                      .length
              : i < start + 5);
          i++) {
        stepId = stepId + 1;
        print("stepId.........................$stepId");
        if (stopFunction) {
          break; // Exit the loop if stopFunction is true
        }

        if (isPaused) {
          await _waitForFlagToChange();
        }

        await Future.delayed(const Duration(seconds: 2), () async {
          if (isPaused) {
            await _waitForFlagToChange();
          }
        });

        if (currentIndex == 5) {
          if (isPaused) {
            await _waitForFlagToChange();
          }
          print("if part...............................");

          setState(() {
            _visibilityList = [false, false, false, false, false];
          });

          await Future.delayed(const Duration(seconds: 2), () async {
            if (isPaused) {
              await _waitForFlagToChange();
            }
          });

          if (isPaused) {
            await _waitForFlagToChange();
          }
          setState(() {
            start += 5;
            currentIndex = 0;
            print("Start $start");
            print("currentIndex $currentIndex");
          });

          break;
        } else if (i ==
            ref
                .read(mapListProvider)[prechecks]["steps"][startModule]["steps"]
                .length) {
          if (isPaused) {
            await _waitForFlagToChange();
          }

          print("last part..........................");
          setState(() {
            titleVisibility = false;
            _visibilityList = [false, false, false, false, false];
            print("titleVisibility $titleVisibility");
          });

          await Future.delayed(
            const Duration(seconds: 2),
            () async {
              if (isPaused) {
                await _waitForFlagToChange();
              }
            },
          );
          if (isPaused) {
            await _waitForFlagToChange();
          }
          // if (titleVisibility == false) {
          //   await _waitForTitle(titleVisibility);
          // }

          if (ref.read(mapListProvider)[prechecks]["steps"][startModule]
                  ["id"] !=
              ref.read(mapListProvider)[prechecks]["steps"].length) {
            print('''ref.read(mapListProvider)[prechecks]["steps"][startModule]
                  ["id"] ${ref.read(mapListProvider)[prechecks]["steps"][startModule]["id"]}''');

            setState(() {
              moduleLength++;
              start = 0;
              currentIndex = 0;
              startModule++;
              titleVisibility = true;
              print("start $start");
              print("currentIndex $currentIndex");
            });
          } else {
            print("Break part.........");

            print('''ref.read(mapListProvider)[prechecks]["steps"][startModule]
                  ["id"] ${ref.read(mapListProvider)[prechecks]["steps"][startModule]["id"]}''');
            stopFunction = true;
            Navigator.push(
                context, MaterialPageRoute(builder: (context) => const Home()));

            break;
          }
        } else {
          print("i..................................$i");
          if (i == 0) {
            if (isPaused) {
              await _waitForFlagToChange();
            }
            print("first part.....................");
            setState(() {
              titleVisibility = true;
              print(titleVisibility);
            });

            if (isPaused) {
              await _waitForFlagToChange();
            }
            await Future.delayed(const Duration(seconds: 1), () async {
              if (isPaused) {
                await _waitForFlagToChange();
              }
            });
          }

          if (isPaused) {
            await _waitForFlagToChange();
          }

          print("else part...............................");

          if (isPaused) {
            await _waitForFlagToChange();
          }
          setState(() {
            _visibilityList[currentIndex] = true;
            print(_visibilityList);
          });

          if (isPaused) {
            await _waitForFlagToChange();
          }

          ref
              .read(mapListProvider.notifier)
              .updateStepState(prechecks, startModule, i, true);
          print(
              "$startModule....$i.....${ref.read(mapListProvider)[prechecks]["steps"][startModule]["steps"][i]["state"]}");

          await player.play(AssetSource(ref.read(mapListProvider)[prechecks]
              ["steps"][startModule]["steps"][i]["Voice"]));
          _playerState = player.state;

          while (_playerState == PlayerState.playing) {
            await Future.delayed(const Duration(milliseconds: 100));
            _playerState = player.state;
          }

          await Future.delayed(const Duration(seconds: 1), () async {
            if (isPaused) {
              await _waitForFlagToChange();
            }
          });
          if (isPaused) {
            await _waitForFlagToChange();
          }

          await Future.delayed(const Duration(seconds: 3), () async {
            if (isPaused) {
              await _waitForFlagToChange();
            }
          }).then((value) async {
            if (_playerState == PlayerState.paused) {
              print("Paused State........................");
              print("Will skip to next iteration..............");
              setState(() {
                currentIndex++;
                print(currentIndex);
              });
            } else {
              print("Next................");
              setState(() {
                currentIndex++;
                print(currentIndex);
              });
            }
          });
          if (isPaused) {
            await _waitForFlagToChange();
          }
        }
      }
    }
  }

  void _togglePause() async {
    if (isPaused) {
      setState(() {
        stopFunction = true;
        print("stopFunction: $stopFunction");
        print("_playerState: $_playerState");
      });
      if (_playerState == PlayerState.playing) {
        print("_playerState: $_playerState");
        await player.pause();
      }
    } else {
      if (_playerState == PlayerState.paused) {
        setState(() {
          stopFunction = true;
          print("stopFunction: $stopFunction");
          print("_playerState: $_playerState");
        });
        await player.resume();
        setState(() {
          stopFunction = false;
          print("stopFunction: $stopFunction");
          print("_playerState: $_playerState");
        });
      } else {
        setState(() {
          stopFunction = false;
          print("stopFunction: $stopFunction");
          print("_playerState: $_playerState");
        });
      }
    }
  }

  Widget _text(String text, bool isVisible, int index) {
    double WIDTH = MediaQuery.of(context).size.width;
    double HEIGHT = MediaQuery.of(context).size.height;
    return AnimatedOpacity(
      opacity: isVisible ? 1.0 : 0.0,
      duration: const Duration(seconds: 2),
      child: SizedBox(
        width: WIDTH * 0.5,
        // color: Colors.amber,
        child: Padding(
          padding: EdgeInsets.symmetric(horizontal: WIDTH * 0.05),
          child: Row(
            crossAxisAlignment: CrossAxisAlignment.start,
            mainAxisAlignment: MainAxisAlignment.start,
            children: [
              Padding(
                padding: EdgeInsets.only(right: WIDTH * 0.01),
                child: const Icon(Icons.check, color: Colors.green),
              ),
              Flexible(
                child: Text(
                  text,
                  style:
                      TextStyle(color: Colors.black, fontSize: HEIGHT * 0.0065),
                  softWrap: true,
                ),
              ),
            ],
          ),
        ),
      ),
    );
  }

  @override
  Widget build(BuildContext context) {
    final mapList = ref.read(mapListProvider);
    double HEIGHT = MediaQuery.of(context).size.height;
    double WIDTH = MediaQuery.of(context).size.width;
    return Scaffold(
